import React from "react";
import Home from "./components/home";
import Navbar from "./components/overlayNavbar"
import { BrowserRouter as Router } from "react-router-dom";


function App() {
  return (
    <>  
      <router>
        <Navbar/>
        <Home/>
      </router> 
    </>    
  );
}

export default App;
